import {  StyleSheet, View, Modal, Button, TextInput, Text} from 'react-native';
import { AntDesign } from '@expo/vector-icons'; 

import ReviewFrom from './ReviewFrom'

function ModalInput({modalOpen,set}){

    return(
        <Modal visible={modalOpen} animationType ={'slide'}  transparent={true}>
            <View style={styles.allSetModal}>
                <AntDesign name="closecircle" size={24} color="black" onPress={()=>{set()}}/>
                <ReviewFrom></ReviewFrom>
            </View>
      </Modal>
    )
}

const styles = StyleSheet.create({
    allSetModal:{
        margin: 20,
        backgroundColor: "white",
        borderRadius: 40,
        padding: 35,
        width: 200,
        justifyContent:'center'
        },
    
});

export default ModalInput;
